package com.example.restapi.services;

import com.example.restapi.entities.DogEntity;
import com.example.restapi.repositories.DogRepository;
import org.springframework.stereotype.Service;

@Service
public class DogServiceImpl implements DogService{

    private final DogRepository dogRepository;

    public DogServiceImpl(DogRepository dogRepository) {
        this.dogRepository = dogRepository;
    }

    @Override
    public void seedDogs() {


        DogEntity dog3 = new DogEntity();
        dog3.setBreed("Bul Terier");
        dog3.setDescription("Scary, but good dog.");
        dog3.setMaleWeight("22-38kg");
        dog3.setFemaleWeight("18-34kg");
        dog3.setLife("10-14 years");
        dog3.setImgUrl("data:image/jpeg;base64,");
        this.dogRepository.saveAndFlush(dog3);
    }
}
